    useEffect(() => {
        fetch(`http://localhost:9295/supermarkets/${supermarket.id}/commodities`)
        .then((r) => r.json())
        .then((data) => {setCommodities(data)})
    }, [])
    console.log(commodities)
    return (
        <div>
            {supermarket.name}, {supermarket.zipcode}

        </div>
    )
}

